INSERT INTO `mdl_question` VALUES (1,2,0,'1','<p>Why do you want to be a writer?<br></p>',1,'',1,1.0000000,0.3333333,'multichoice',1,'localhost+170131123522+qYUKuF','localhost+170131123522+FvO6R4',0,1485866122,1485866122,2,2),(2,2,0,'2','<p>Do you consider yourself a good writer at this moment?<br></p>',1,'',1,1.0000000,0.3333333,'multichoice',1,'localhost+170131123708+cP8rIo','localhost+170131141939+SDG929',0,1485866228,1485872379,2,2),(3,2,0,'3','<p>Do you consider yourself disciplined to be a good writer?<br></p>',1,'',1,1.0000000,0.3333333,'multichoice',1,'localhost+170131123851+C0hF2r','localhost+170131123907+mF1EBH',0,1485866331,1485866347,2,2),(4,2,0,'4','<b>Did you read the book?<br></b><p><br></p>',1,'',1,1.0000000,0.3333333,'multichoice',1,'localhost+170131124018+7wd6VL','localhost+170131124018+i7uJ2m',0,1485866418,1485866418,2,2),(5,2,0,'5','<p>Can you be concentrated in the midst of many distractions?<br></p>',1,'',1,1.0000000,0.3333333,'multichoice',1,'localhost+170131124150+7Z4Dh9','localhost+170131124150+Jx4en2',0,1485866510,1485866510,2,2),(6,2,0,'6','<p>Do you think grammars are important in writing?<br></p>',1,'',1,1.0000000,0.3333333,'multichoice',1,'localhost+170131141725+k7AB45','localhost+170131141725+JgcNYj',0,1485872245,1485872245,2,2),(7,2,0,'7','<p>The vocation writing should be taken as a full-time responsibility?<br></p>',1,'',1,1.0000000,1.0000000,'truefalse',1,'localhost+170131141910+h1mpDW','localhost+170131141911+kme0x5',0,1485872350,1485872350,2,2),(8,2,0,'8','<p>Which of these is a notable writer?<br></p>',1,'',1,1.0000000,0.3333333,'multichoice',1,'localhost+170131142151+N4VPvm','localhost+170131142151+yn34Mj',0,1485872511,1485872511,2,2),(9,2,0,'9','You are a student.<br>',1,'',1,1.0000000,1.0000000,'truefalse',1,'localhost+170204135446+Hm8CCE','localhost+170204141330+FTgHmU',0,1486216486,1486217610,2,2),(10,2,0,'1','<p>I want to be a great editor.<br></p>',1,'',1,1.0000000,1.0000000,'truefalse',1,'localhost+170208144211+nGNN9G','